def returnCharacter(byteH, byteL):
    bitMaskH = 0x07
    bitMaskL = 0xB8

    filteredH = int(byteH,16) & bitMaskH
    filteredL = int(byteL,16) & bitMaskL

    #print str(hex(filteredH)), str(hex(filteredL))

    dictValue = (filteredH,filteredL)

    lookupTable = {
        (7,168):'0', #0x07 0xA8
        (0,40):'1', #0x00 0x28
        (6,152):'2', #0x06 0x98
        (4,184):'3', #0x04 0xB8
        (1,56):'4', #0x01 0x38
        (5,176):'5', #0x05 0xB0
        (7,176):'6', #0x07 0xB0
        (0,168):'7', #0x00 0xA8
        (7,184):'8', #0x07 0xB8
        (5,184):'9', #0x05 0xB8
        (3,152):'P', #0x03 0x98
        (0,0):' ', #0x00 0x00
        }

    if dictValue in lookupTable.keys():
        return lookupTable[dictValue]
    else:
        return str(hex(dictValue[0])), str(hex(dictValue[1]))

